func minOperations(nums []int, k int) int {
    // This map tracks if a number has been seen (true) or not (false).
    seen := make(map[int]bool)

    // The count of operations needed to collect all numbers from 1 to k.
    operations := 0

    // Iterate through the array from the end.
    for i := len(nums) - 1; i >= 0; i-- {
        // If the number is within our target range and hasn't been seen yet,
        // mark it as seen. This is because we're collecting it into our set.
        if nums[i] <= k && !seen[nums[i]] {
            seen[nums[i]] = true
            // Decrease k as we've now collected this number.
            k--
        }

        // Increment the number of operations each time,
        // as we're effectively removing the last element in each iteration.
        operations++

        // If k becomes 0, we've collected all numbers from 1 to k.
        if k == 0 {
            // Return the number of operations done so far.
            return operations
        }
    }

    // In case something goes wrong, which shouldn't happen given the problem's constraints,
    // return the total number of operations as the length of the nums array.
    // This acts as a failsafe, although we expect to return within the loop.
    return operations
}
